                // 解密会话密钥
                const encryptedSessionKeyData = base64ToArrayBuffer(encryptedSessionKeyBase64);
                const masterIVData = base64ToArrayBuffer(masterIVBase64);
                
                const sessionKeyData = await crypto.subtle.decrypt(
                    {
                        name: 'AES-GCM',
                        iv: masterIVData
                    },
                    masterKey,
                    encryptedSessionKeyData
                );
                
                // 导入会话密钥
                const sessionKey = await crypto.subtle.importKey(
                    'raw',
                    sessionKeyData,
                    { name: 'AES-GCM', length: 256 },
                    false,
                    ['decrypt']
                );
                
                // 解密所有块
                const decryptedChunks = [];
                const totalChunks = chunkData.length;
                
                for (let i = 0; i < totalChunks; i++) {
                    const chunk = chunkData[i];
                    
                    try {
                        // 解码块数据
                        const encryptedData = base64ToArrayBuffer(chunk.data);
                        const iv = base64ToArrayBuffer(chunk.iv);
                        const additionalData = base64ToArrayBuffer(chunk.additionalData);
                        
                        // 解密块
                        const decryptedBuffer = await crypto.subtle.decrypt(
                            {
                                name: 'AES-GCM',
                                iv: iv,
                                additionalData: additionalData
                            },
                            sessionKey,
                            encryptedData
                        );
                        
                        decryptedChunks[chunk.index] = new Uint8Array(decryptedBuffer);
                        
                    } catch (error) {
                        throw new Error(`解密数据块 ${chunk.index + 1} 时出错: ${error.message}`);
                    }
                }
                
                // 组合所有解密后的块
                const totalLength = decryptedChunks.reduce((sum, chunk) => sum + chunk.length, 0);
                const combinedData = new Uint8Array(totalLength);
                let offset = 0;
                
                for (let i = 0; i < decryptedChunks.length; i++) {
                    if (decryptedChunks[i]) {
                        combinedData.set(decryptedChunks[i], offset);
                        offset += decryptedChunks[i].length;
                    }
                }
                
                // 将解密后的数据转换为文本
                const decoder = new TextDecoder();
                const decryptedHTML = decoder.decode(combinedData);
                
                // 完全替换当前文档内容
                document.open();
                document.write(decryptedHTML);
                document.close();
                
            } catch (error) {
                console.error('自动解密失败:', error);
                // 如果解密失败，显示错误信息
                document.body.innerHTML = '<div style="padding: 20px; text-align: center; color: #ff4757; font-family: Arial, sans-serif;"><h2>解密失败</h2><p>内容无法加载: ' + error.message + '</p><button onclick="location.reload()">重试</button></div>';
            }
        }
        
        // 页面加载完成后自动解密
        document.addEventListener('DOMContentLoaded', function() {
            setTimeout(autoDecryptAndDisplay, 100);
        });
        
        // 防止右键查看源代码
        document.addEventListener('contextmenu', function(e) {
            e.preventDefault();
            return false;
        });
        
        // 防止F12开发者工具
        document.addEventListener('keydown', function(e) {
            if (e.key === 'F12' || (e.ctrlKey && e.shiftKey && e.key === 'I') || (e.ctrlKey && e.key === 'U')) {
                e.preventDefault();
                return false;
            }
        });
        
        // 防止控制台打开
        setInterval(function() {
            if (window.console && window.console.firebug) {
                document.body.innerHTML = '<div style="padding: 20px; text-align: center; color: #ff4757; font-family: Arial, sans-serif;"><h2>安全警告</h2><p>检测到开发者工具，页面内容已锁定</p></div>';
            }
        }, 1000);
    </script>
</body>
